// src/app/core/services/print.service.ts

import { Injectable } from '@angular/core';
import { SaleRequest } from '../models/sale.model';

@Injectable({
  providedIn: 'root',
})
export class PrintService {
  // üñºÔ∏è Reemplaza esta cadena con el Base64 de tu logo real
  // Puedes obtenerlo en sitios como base64-image.de
  private readonly LOGO_BASE64 =
    'data:image/png;base64,';

  constructor() {}

  printTicket(sale: SaleRequest, folio: number): void {
    const printWindow = window.open('', '_blank', 'width=600,height=600');
    if (!printWindow) return;

    const ticketHtml = this.generateTicketHTML(sale, folio);

    printWindow.document.write(ticketHtml);
    printWindow.document.close();

    setTimeout(() => {
      printWindow.print();
      printWindow.close();
    }, 500);
  }

  private generateTicketHTML(sale: SaleRequest, folio: number): string {
    const date = new Date().toLocaleString('es-MX');

    const itemsHtml = sale.items
      .map(
        (item) => `
      <tr>
        <td colspan="2" class="item-name">${
          item.id_producto
        } - Producto Detalle</td>
      </tr>
      <tr>
        <td class="item-qty">${item.cantidad} x ${this.formatCurrency(
          item.precio
        )}</td>
        <td class="item-total">${this.formatCurrency(
          item.cantidad * item.precio
        )}</td>
      </tr>
    `
      )
      .join('');

    return `
      <html>
        <head>
          <style>
            @page { size: 80mm auto; margin: 0; }
            body { 
              font-family: 'Arial', sans-serif; 
              width: 72mm; /* Dejamos margen interno para los 80mm f√≠sicos */
              padding: 4mm; 
              font-size: 11px; 
              color: #000;
            }
            .text-center { text-align: center; }
            .text-right { text-align: right; }
            .bold { font-weight: bold; }
            
            /* Logo Styling */
            .logo-container { margin-bottom: 10px; }
            .logo { width: 40mm; height: auto; }

            .header-info { font-size: 10px; margin-bottom: 10px; }
            .divider { border-top: 1px dashed #000; margin: 8px 0; }
            
            table { width: 100%; border-collapse: collapse; }
            .item-name { padding-top: 5px; font-weight: bold; }
            .item-qty { font-size: 10px; }
            .item-total { text-align: right; vertical-align: bottom; }

            .totals-table { margin-top: 10px; }
            .total-final { font-size: 14px; border-top: 1px solid #000; padding-top: 5px; }

            /* üìú Secci√≥n de Pol√≠ticas */
            .policy-section { 
              margin-top: 15px; 
              font-size: 9px; 
              line-height: 1.1; 
              border: 1px solid #000;
              padding: 5px;
            }
          </style>
        </head>
        <body>
          <div class="text-center logo-container">
            <img src="${this.LOGO_BASE64}" class="logo" alt="Logo">
          </div>

          <div class="text-center header-info">
            <div class="bold" style="font-size: 14px;">GUAYABERAS "EL REY"</div>
            <div>Calle 60 x 45 y 47 Centro</div>
            <div>M√©rida, Yucat√°n, M√©xico</div>
            <div>Tel: (999) 123-4567</div>
          </div>

          <div class="divider"></div>
          <div><span class="bold">FOLIO:</span> #${folio}</div>
          <div><span class="bold">FECHA:</span> ${date}</div>
          <div><span class="bold">VENDEDOR:</span> ${sale.id_usuario}</div>
          <div class="divider"></div>

          <table>
            ${itemsHtml}
          </table>

          <div class="divider"></div>

          <table class="totals-table">
            <tr><td>SUBTOTAL:</td><td class="text-right">${this.formatCurrency(
              sale.subtotal
            )}</td></tr>
            <tr><td>DESCUENTO:</td><td class="text-right">-${this.formatCurrency(
              sale.descuento_global
            )}</td></tr>
            <tr><td>ENV√çO:</td><td class="text-right">${this.formatCurrency(
              sale.envio
            )}</td></tr>
            <tr><td>IVA (16%):</td><td class="text-right">${this.formatCurrency(
              sale.impuestos
            )}</td></tr>
            <tr class="total-final"><td class="bold">TOTAL:</td><td class="text-right bold">${this.formatCurrency(
              sale.total_final
            )}</td></tr>
          </table>

          <div style="margin-top: 5px;">M√âTODO DE PAGO: <span class="bold">${sale.metodo_pago.toUpperCase()}</span></div>

          <div class="divider"></div>

          <div class="policy-section">
            <div class="text-center bold">POL√çTICAS DE DEVOLUCI√ìN</div>
            <ul>
              <li>Cambios permitidos en los primeros 7 d√≠as naturales.</li>
              <li>La prenda debe conservar sus etiquetas y no presentar da√±os.</li>
              <li>No se realizan reembolsos en efectivo, se otorga vale de tienda.</li>
              <li>Prendas en oferta/liquidaci√≥n no tienen cambios.</li>
            </ul>
          </div>

          <div class="text-center" style="margin-top: 15px;">
            ¬°Gracias por preferir la elegancia artesanal!
          </div>
        </body>
      </html>
    `;
  }

  /**
   * M√âTODO NUEVO: Imprime el ticket de un pedido o apartado
   * @param order Datos del pedido
   * @param orderId ID generado por la base de datos
   */
  printOrderTicket(order: any, orderId: number): void {
    const printWindow = window.open('', '_blank', 'width=600,height=600');
    if (!printWindow) return;

    const htmlContent = this.generateOrderTicketHtml(order, orderId);

    printWindow.document.write(htmlContent);
    printWindow.document.close();

    setTimeout(() => {
      printWindow.focus();
      printWindow.print();
      printWindow.close();
    }, 250);
  }

  private generateOrderTicketHtml(order: any, orderId: number): string {
    const fechaPedido = new Date().toLocaleDateString();
    // 'order' viene del payload que enviamos al backend

    return `
      <html>
        <head>
          <style>
            body { font-family: 'Courier New', Courier, monospace; font-size: 12px; width: 58mm; margin: 0; padding: 5mm; }
            .text-center { text-align: center; }
            .bold { font-weight: bold; }
            .divider { border-bottom: 1px dashed #000; margin: 5px 0; }
            .total-section { width: 100%; margin-top: 5px; }
            .text-right { text-align: right; }
            .status-box { border: 1px solid #000; padding: 5px; margin: 10px 0; text-align: center; font-weight: bold; }
          </style>
        </head>
        <body>
          <div class="text-center">
            <img src="${
              this.LOGO_BASE64
            }" style="width: 80px; filter: grayscale(1);"><br>
            <span class="bold">GUAYABERAS ARTESANALES</span><br>
            FOLIO PEDIDO: #ORD-${orderId}
          </div>

          <div class="divider"></div>
          <div>FECHA PEDIDO: ${fechaPedido}</div>
          <div class="bold">ENTREGA: ${order.fecha_entrega}</div>
          <div class="divider"></div>
          
          <div>CLIENTE: ${order.cliente_nombre || 'P√∫blico General'}</div>
          <div class="divider"></div>

          <table style="width: 100%">
            ${order.items
              .map(
                (item: any) => `
              <tr>
                <td colspan="2">${item.nombre || 'Producto'}</td>
              </tr>
              <tr>
                <td>${item.cantidad} x ${this.formatCurrency(item.precio)}</td>
                <td class="text-right">${this.formatCurrency(
                  item.cantidad * item.precio
                )}</td>
              </tr>
            `
              )
              .join('')}
          </table>

          <div class="divider"></div>

          <table class="total-section">
            <tr><td>TOTAL PEDIDO:</td><td class="text-right bold">${this.formatCurrency(
              order.total_orden
            )}</td></tr>
            <tr><td>ANTICIPO:</td><td class="text-right">-${this.formatCurrency(
              order.total_pagado
            )}</td></tr>
            <tr style="font-size: 14px;">
              <td class="bold">SALDO PENDIENTE:</td>
              <td class="text-right bold">${this.formatCurrency(
                order.total_orden - order.total_pagado
              )}</td>
            </tr>
          </table>

          <div class="status-box">
             M√âTODO DE PAGO: ${order.metodo_pago.toUpperCase()}
          </div>

          <div class="text-center" style="margin-top: 10px;">
            Guarde este ticket para recoger su prenda.<br>
            ¬°Gracias por su confianza!
          </div>
        </body>
      </html>
    `;
  }
  /**
   * Genera e imprime el ticket de liquidaci√≥n final (Saldo 0)
   */
  printLiquidationTicket(orderData: any): void {
    const printWindow = window.open('', '_blank', 'width=600,height=600');
    if (!printWindow) return;

    const htmlContent = `
    <html>
      <head>
        <style>
          body { font-family: 'Courier New', monospace; font-size: 12px; width: 58mm; margin: 0; padding: 4mm; }
          .text-center { text-align: center; }
          .bold { font-weight: bold; }
          .divider { border-bottom: 1px dashed #000; margin: 8px 0; }
          .total-table { width: 100%; margin-top: 10px; }
          .text-right { text-align: right; }
          .liquidado-banner { 
            background-color: #000; color: #fff; 
            text-align: center; padding: 5px; 
            font-weight: bold; margin: 10px 0;
            text-transform: uppercase;
          }
          .signature-space { margin-top: 30px; border-top: 1px solid #000; text-align: center; padding-top: 5px; }
        </style>
      </head>
      <body>
        <div class="text-center">
          <img src="${
            this.LOGO_BASE64
          }" style="width: 70px; filter: grayscale(1);"><br>
          <span class="bold">GUAYABERAS ARTESANALES</span><br>
          <span>Comprobante de Entrega</span>
        </div>

        <div class="divider"></div>
        <div><b>FOLIO:</b> #ORD-${orderData.id_pedido}</div>
        <div><b>FECHA ENTREGA:</b> ${new Date().toLocaleDateString()}</div>
        <div><b>CLIENTE:</b> ${orderData.cliente_nombre}</div>
        <div class="divider"></div>

        <table style="width: 100%">
          ${orderData.items
            .map(
              (item: any) => `
            <tr>
              <td colspan="2">${item.nombre}</td>
            </tr>
            <tr>
              <td>${item.cantidad} x ${this.formatCurrency(item.precio_unitario)}</td>
              <td class="text-right">${this.formatCurrency(
                item.cantidad * item.precio_unitario
              )}</td>
            </tr>
          `
            )
            .join('')}
        </table>

        <div class="divider"></div>
        <table class="total-table">
          <tr>
            <td>TOTAL DE LA ORDEN:</td>
            <td class="text-right">${this.formatCurrency(
              orderData.total_orden
            )}</td>
          </tr>
          <tr>
            <td colspan="2">ANTICIPOS PREVIOS:</td>
          </tr>
          ${orderData.abonos
            .map(
              (abono: any) => `
            <tr>
              <td>${abono.metodo_pago}</td>
              <td class="text-right">${this.formatCurrency(abono.monto)}</td>
            </tr>
          `
            )
            .join('')}
          <tr class="bold">
            <td>PAGO DE LIQUIDACI√ìN:</td>
            <td class="text-right">${this.formatCurrency(
              orderData.total_orden
            )}</td>
          </tr>
        </table>

        <div class="liquidado-banner">
          CUENTA LIQUIDADA - SALDO $0.00
        </div>

        <div class="signature-space">
          Firma de Conformidad del Cliente
        </div>

        <div class="text-center" style="margin-top: 15px; font-size: 10px;">
          Gracias por permitirnos vestir sus momentos especiales.<br>
          <b>www.tusitio.com</b>
        </div>
      </body>
    </html>
  `;

    printWindow.document.write(htmlContent);
    printWindow.document.close();
    setTimeout(() => {
      printWindow.print();
      printWindow.close();
    }, 250);
  }
  private formatCurrency(value: number): string {
    return new Intl.NumberFormat('es-MX', {
      style: 'currency',
      currency: 'MXN',
    }).format(value);
  }
}
